/**
 * Created by George on 24/03/2019.
 */
import React from "react";
import dateFns from "date-fns";

function Bla(x){
  return x;
}


class CalendarDemo extends React.Component {
  render () {
    return (
      <mobiscroll.Form inputStyle="box">
        <div className="mbsc-grid mbsc-form-grid">
          <div className="mbsc-row">
            <div className="mbsc-col-sm-12 mbsc-col-md-6">
              <label>
                Mobile
                <mobiscroll.Calendar
                  display="bubble"
                  placeholder="Please Select..."
                />
              </label>
            </div>
            <div className="mbsc-col-sm-12 mbsc-col-md-6">
              <label>
                Desktop
                <mobiscroll.Calendar
                  display="bubble"
                  touchUi={false}
                  placeholder="Please Select..."
                />
              </label>
            </div>
          </div>
        </div>
      </mobiscroll.Form>
    );
  }
}


export default CalendarDemo;

